import React from 'react';
import { 
    ExperienceContainer,
     Title, 
     SubTitle,
      Description,
      ProjectStatusContainer
    } from './content.styles';

interface Props {
    title: string,
    subTitle: string,
    timeFrame?: string,
    description: string,
    projectStatus?: {
        completed: boolean,
        sourceCode: string
    } | any
}

const Content: React.FC<Props> = ({ title, subTitle, description, projectStatus }) => (
    <ExperienceContainer>
      <Title>{ title }</Title>
      <SubTitle>{subTitle}</SubTitle>
      <Description>
        <p>{description}</p>
        <ProjectStatusContainer>
          <p><strong>{projectStatus.completed ? 'Completed' : 'In progress'}</strong></p>
          <p>
            <strong>Source Code</strong>
            <a
              href="https://github.com/RicardoAVS/RockPaperScissor"
              target="_blank"
              >{projectStatus?.sourceCode}
            </a>
          </p>
          </ProjectStatusContainer>
        </Description>
    </ExperienceContainer>
)

export default Content;
